import React, {useState} from 'react'



const TreeItem = ({item, openNode}) => {


    return(
        <div style={{paddingLeft: '20px'}}>
            <h4 onClick={() => console.log(item.id)}>{item.title}</h4>
            {item.items && item.state === true ? <Tree items={item.items}/> : null}
        </div>
    )
}


const Tree = ({items}) => <div>
    {items.map((i, key) => <TreeItem key={key} item={i}/>)}    
</div>


export default Tree;
